+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="7EF0907049F5D4A162CA83A307971B3B", NativeString="You been keeping safe out there?", LocalizedStrings=(("ar","أنا أجهّز القارب. مضى الزعيم والطاقم قدمًا."),("en","I'm prepping the boat. The boss and crew went ahead."),("de","Ich bereite das Boot vor. Der Boss und die Crew sind schon mal los."),("es","Estoy preparando el barco. El jefe y la banda se han adelantado."),("es-419","Estoy preparando el barco. El jefe y el equipo se adelantaron."),("fr","Je prépare le bateau. Le patron et les autres sont partis devant."),("it","Preparo la barca. Il boss e l'equipaggio sono andati avanti."),("ja","ボートの準備をしてるんだ。ボスと他のクルーは先に行った。"),("ko","보트를 준비할게. 보스와 다른 멤버들은 먼저 출발했어."),("pl","Szykuję łódź. Szef z ekipą ruszyli przodem."),("pt-BR","Estou preparando o barco. O chefe foi na frente junto da equipe."),("ru","Я готовлю судно. Босс с командой уже отправились."),("tr","Tekneyi hazırlıyorum. Patron ve ekip işe koyuldu.")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="F1FDCA7049F34F8BF51DE98444CE4399", NativeString="The gang's all here and the boss is back. Weird.", LocalizedStrings=(("ar","يمنحني لم شمل الطاقم شعورًا غريبًا. شعور غريب لكنه جيد."),("en","Weird to have the crew all back together. But the good type of weird."),("de","Es ist komisch, dass die Crew wieder zusammen ist. Aber auf gute Art komisch."),("es","Resulta extraño que la banda vuelva a estar junta. Pero extraño en el buen sentido."),("es-419","Es extraño tener a todos de nuevo reunidos. Extraño en el buen sentido."),("fr","Ça fait bizarre de voir le gang à nouveau réuni. Mais ça fait surtout plaisir."),("it","Mi fa strano rivedere la banda insieme, ma strano in senso buono."),("ja","クルーがまた全員そろうだなんて、変な気分だよ。いい意味でな。"),("ko","멤버가 모두 다시 모이니 이상한 기분이 들어. 좋은 쪽으로 이상한 기분."),("pl","Ekipa znów jest razem – dziwne uczucie. Ale w pozytywnym sensie."),("pt-BR","É estranho ver a equipe reunida de novo. Mas é um estranho bom."),("ru","Так странно снова видеть всю банду в сборе. Но в хорошем смысле."),("tr","Ekibi tekrar bir arada görmek tuhaf bir duygu. Tuhaf ama iyi anlamda.")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="100FA7F345D9F96A0FA160B36D5EDD8B", NativeString="Things feel like they're gonna change now.", LocalizedStrings=(("ar","سيُبحر هذا القارب قريبًا وسيتجه الطاقم بأكمله نحو... مكان ما."),("en","Soon this boat will set sail and the whole crew will be headed... somewhere."),("de","Schon bald legt dieses Boot ab und die Crew schippert ... irgendwohin."),("es","Este barco zarpará pronto y la banda pondrá rumbo... a alguna parte."),("es-419","Pronto este barco zarpará y el equipo pondrá rumbo a... alguna parte."),("fr","Le bateau va bientôt lever l'ancre et le gang se rendra... quelque part."),("it","Presto questa barca salperà e la banda al completo andrà... da qualche parte."),("ja","間もなくボートは出港する。クルー全員が出発するのさ… どこかへとな。"),("ko","이제 이 보트가 출발하면 멤버 모두가 가는 거야... 알 수 없는 곳으로."),("pl","Niedługo łódź będzie mogła wypłynąć i cała ekipa uda się… przed siebie."),("pt-BR","Logo, logo o barco vai zarpar e toda a equipe vai... para algum lugar."),("ru","Скоро наше судно поднимет якорь, и наша банда поплывёт… куда-нибудь."),("tr","Yakında bu tekneyle yelken açacağız ve tüm ekiple... bir yerlere gideceğiz.")))
