+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="9A2F36174295CC72BD196EA1B94E549B", NativeString="TBD", LocalizedStrings=(("ar","تتضمن سيارة وبدائل للسيارة وملصقات قابلة للتخصيص! عناصر هذه الحزمة مقتصرة على هيكل سيارة Werewolf."),("en","Includes car, car variants, and customizable decals! Items in this bundle are restricted to the Werewolf car body."),("de","Enthält ein Auto, Autovarianten und anpassbare Aufkleber! Die Gegenstände in diesem Paket sind auf die Karosserie „Werwolf“ beschränkt."),("es","Incluye coche, variantes de coche y calcomanías personalizables. Los objetos de este lote solo están disponibles para la carrocería del Hombre lobo."),("es-419","¡Incluye un auto, variantes de auto y calcomanías personalizables! Los objetos de este lote solo están disponibles para la carrocería Hombre lobo."),("fr","Comprend une voiture et des stickers personnalisables ! Les objets de ce pack ne fonctionnent que sur le châssis Loup-garou."),("it","Include l'auto, le varianti e gli adesivi personalizzabili! Gli oggetti di questo bundle sono riservati alla carrozzeria Licantropo."),("ja","車、車のバリエーション、カスタマイズ可能なデカールを収録！ このバンドル内のアイテムは、マシンのボディ​「Werewolf」に限定されています。"),("ko","차량, 차량 추가 스타일, 커스터마이징 가능한 데칼 포함! 이 번들의 아이템은 Werewolf 차체에만 사용할 수 있습니다."),("pl","Zawiera samochód, warianty samochodu i konfigurowalne wzory! Elementy tego zestawu można wykorzystać tylko z karoserią Werewolf."),("pt-BR","Inclui carro, variantes do carro e Adesivos personalizados! Os itens deste pacote são restritos ao Chassi Lobisomem."),("ru","Включает машину, варианты внешнего вида машины и настраиваемые декали! Предметы из этого комплекта совместимы только с кузовом Werewolf."),("tr","Araba, araba çeşitleri ve özelleştirebilir çıkartmalar içerir! Bu paketteki eşyaları yalnızca Kurt Adam araba gövdesiyle kullanabilirsin.")))
