+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="ADADAAF24C4E5F1826F0F588081F848F", NativeString="Oh yeah, this is definitely right!!", LocalizedStrings=(("ar","أوه، نعم، صحيح بلا شك!"),("en","Oh yeah, this is definitely right!!"),("de","Oh ja, das stimmt definitiv!!"),("es","¡Ahora sí! Seguro que está aquí. - Cerbero"),("es-419","¡Sí, vamos por buen camino!"),("fr","Oui, elle doit être ici !!"),("it","Oh, sì, è decisamente quello giusto!"),("ja","そうそう、間違いなくここだ！！"),("ko","그래, 바로 이거야!"),("pl","O tak, to na pewno to!"),("pt-BR","Ah, sim, com certeza foi isso!"),("ru","«Да, мы всё правильно делаем!» — Цербер."),("tr","Evet, evet buydu!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="82ECB7034183BDA4D00ED687E482CC96", NativeString="Yeah! Yeah! Yeah! This must be it! - Cerberus", LocalizedStrings=(("ar","نعم! نعم! هذه هي! - سيربيروس"),("en","Yeah! Yeah! Yeah! This must be it! - Cerberus"),("de","Ja! Ja! Ja! Genau da! – Zerberus"),("es","¡Aquí es, sin duda! - Cerbero"),("es-419","¡Sí, es aquí! No tengo dudas. - Cerbero"),("fr","Pas de doute, on est au bon endroit ! - Cerbère"),("it","Sì! Sì! Sì! Dev'essere questo! - Cerbero"),("ja","そうだ！ そう！ ここだ！ 間違いない！ - ケルベロス"),("ko","그래! 맞아! 좋아! 바로 이거야! - 케르베로스"),("pl","Tak! Tak! Tak! To tutaj! – Cerber"),("pt-BR","Isso! Isso! É esse mesmo! — Cérbero"),("ru","«Да! Это он! Я уверен!» — Цербер."),("tr","Evet! Evet! Evet! İşte bu! - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="E687BBA14C9E1F43B8EAA39EAEE38732", NativeString="Aw, this isn't my Artifact. That’s just my stick - Cerberus", LocalizedStrings=(("ar","أوه، معذرة! إنها عصاي وحسب - سيربيروس"),("en","Aw, this isn't my Artifact. That’s just my stick - Cerberus"),("de","Oh, das ist nicht mein Artefakt. Das ist nur mein Stöckchen. – Zerberus"),("es","Pues no es el artefacto... Es mi palo. - Cerbero"),("es-419","Este no es el artefacto. Solo es un palo. - Cerbero"),("fr","Oh non, ce n'est pas ma relique. Seulement mon bâton. - Cerbère"),("it","Oh, questo non è il mio Manufatto. È il mio bastoncino. - Cerbero"),("ja","おっと、遺物じゃなかったか。それは俺の棒だ。 - ケルベロス"),("ko","이런, 내 유물이 아니야. 그냥 내 막대기잖아. - 케르베로스"),("pl","Ups, mój błąd! To tylko mój patyk. – Cerber"),("pt-BR","Ah, não! Não é o meu Artefato, é o meu graveto! — Cérbero"),("ru","«Ой, я перепутал. Это просто моя палочка» — Цербер."),("tr","Ah, üzgünüm! Sadece çubuğummuş... - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="A3D8B49E45BCA73EA62F399BF20CD83E", NativeString="I wouldn't forget it in such an obvious place... would I? - Cerberus", LocalizedStrings=(("ar","ما كنت لأنساها في مكان بذلك الوضوح - سيربيروس"),("en","I wouldn't forget it in such an obvious place... would I? - Cerberus"),("de","An so einer offensichtlichen Stelle würde ich es nicht vergessen, oder? – Zerberus"),("es","No me lo dejaría en un sitio tan obvio, ¿no? - Cerbero"),("es-419","¿Crees que lo dejaría en un lugar tan obvio? - Cerbero"),("fr","Je ne l'aurais quand même pas oubliée dans un endroit aussi visible, si ? - Cerbère"),("it","Non lo dimenticherei in un posto così ovvio... giusto? - Cerbero"),("ja","そんなわかりやすい場所に忘れてくるわけないさ。 - ケルベロス"),("ko","내가 그렇게 뻔한 곳에서 잃어버릴 리가 없는데. - 케르베로스"),("pl","Przecież bym go nie zapomniał w tak oczywistym miejscu. – Cerber"),("pt-BR","Eu não esqueceria o artefato num lugar tão óbvio... não é? — Cérbero"),("ru","«Я бы не забыл его в таком очевидном месте» — Цербер."),("tr","Yok canım o kadar da ortalık yerde unutmuş olamam. - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="AD3F03B749928E97A49580A4D02B5A3D", NativeString="Yes! You found it! Dig it up!!! - Cerberus", LocalizedStrings=(("ar","نعم! وجدتها! استخرجها!!! - سيربيروس"),("en","Yes! You found it! Dig it up!!! - Cerberus"),("de","Super! Du hast es gefunden! Grabe es aus!!! – Zerberus"),("es","¡Toma! ¡Lo has encontrado! ¡Desentiérralo, venga! - Cerbero"),("es-419","¡Sí! ¡Lo encontraste! ¡Desentiérralo! - Cerbero"),("fr","Oui ! Vous l'avez trouvée ! Déterrez-la !! - Cerbère"),("it","Sì! L'hai trovato! Dissotterralo!! - Cerbero"),("ja","よし！ 見つけたな！ 掘り出すんだ！！ - ケルベロス"),("ko","좋았어! 찾았구나! 어서 캐내 봐!!! - 케르베로스"),("pl","Tak! To mój skarb! Wykop go!!! – Cerber"),("pt-BR","Isso! Você encontrou! Cava, cava! — Cérbero"),("ru","«Да! Тебе удалось найти его! Копай скорее!» — Цербер."),("tr","Evet! Buldun! Hadi kaz!!! - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="8E11D6A7488462C05483ED943CCC29A3", NativeString="I bet it's my Artifact!! - Cerberus", LocalizedStrings=(("ar","أراهن أنها قطعتي الأثرية!! - سيربيروس"),("en","I bet it's my Artifact!! - Cerberus"),("de","Ich wette, es ist mein Artefakt!! – Zerberus"),("es","¡Seguro que es mi artefacto! - Cerbero"),("es-419","¡Seguro que es mi artefacto! - Cerbero"),("fr","Je suis sûr que c'est ma relique !! - Cerbère"),("it","Scommetto che è il mio Manufatto! - Cerbero"),("ja","俺の遺物に違いない！！ - ケルベロス"),("ko","분명 내 유물일 거야!! - 케르베로스"),("pl","To musi być mój artefakt! – Cerber"),("pt-BR","Com certeza é o meu artefato! — Cérbero"),("ru","«Это точно мой артефакт!» — Цербер."),("tr","Kesin benim eserim o! - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="EEFB6B3B4D7CB44C831BE589D5F0345D", NativeString="Oh, I was looking for that frisbee! Well, back to hunting down my Artifact... - Cerberus", LocalizedStrings=(("ar","أوه، كنت أبحث عن قرصي الطائر! حسنًا، عد إلى مطاردة قطعتي الأثرية... - سيربيروس"),("en","Oh, I was looking for that frisbee! Well, back to hunting down my Artifact... - Cerberus"),("de","Oh, ich habe nach dieser Frisbee gesucht! Naja, zurück zur Jagd nach meinem Artefakt ... – Zerberus"),("es","¡Anda! Pues llevaba tiempo buscando este frisbi... En fin, volvamos a la búsqueda del artefacto. - Cerbero"),("es-419","¡Llevaba tiempo buscando este frisbi! Bueno... sigamos buscando el artefacto. - Cerbero"),("fr","Oh, je le cherchais ce frisbee ! Mais ça ne nous dit toujours pas où se trouve ma relique...  - Cerbère"),("it","Oh, lo stavo cercando quel frisbee! Beh, rimettiamoci a caccia del mio Manufatto... - Cerbero"),("ja","お、そのフリスビーを探してたんだ！ さて、俺の遺物探しに戻ろうか… - ケルベロス"),("ko","오, 그 프리스비를 찾고 있긴 했는데! 아무튼, 다시 유물 찾기로 돌아가자... - 케르베로스"),("pl","O, szukałem tego frisbee! No nic, wracam do tropienia artefaktu. – Cerber"),("pt-BR","Estava procurando esse frisbee! Bom, podemos continuar em busca do meu Artefato... — Cérbero"),("ru","«Ой! Я как раз искал этот летающий диск. Но... вернёмся к артефакту» — Цербер."),("tr","Hah ben de frizbim nerde diyordum! Şimdi devam edebiliriz eserimi aramaya... - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="A51B42AD479510BFA811CCB57707F5E4", NativeString="This is my favorite spot on the whole Island. The Artifact's definitely here. - Cerberus", LocalizedStrings=(("ar","هذا هو المكان المفضل لدي على الجزيرة بأكملها. القطعة الأثرية هنا بالتأكيد. - سيربيروس"),("en","This is my favorite spot on the whole Island. The Artifact's definitely here. - Cerberus"),("de","Das ist mein Lieblingsplatz auf der ganzen Insel. Das Artefakt ist definitiv hier. – Zerberus"),("es","Este es mi lugar favorito de toda la isla. Segurísimo que el artefacto está aquí. - Cerbero"),("es-419","Este es mi lugar favorito de toda la isla. El artefacto tiene que estar aquí sin lugar a dudas. - Cerbero"),("fr","C'est mon endroit préféré sur l'île. La relique est forcément là. - Cerbère"),("it","Questo è il mio posto preferito in tutta l'Isola. Il Manufatto si trova sicuramente qui. - Cerbero"),("ja","ここは島全体で一番のお気に入りスポットなんだよ。遺物は絶対ここにある。 - ケルベロス"),("ko","섬에서 내가 제일 좋아하는 장소야. 유물은 분명 여기 있을 거야. - 케르베로스"),("pl","To moja ulubiona miejscówka na całej Wyspie. Artefakt musi tu być. – Cerber"),("pt-BR","Esse é meu lugar favorito da Ilha. Com certeza o Artefato está aqui. — Cérbero"),("ru","«Это моё самоё любимое место на острове. Артефакт должен быть здесь!» — Цербер."),("tr","Burası adadaki en favori yerim olduğuna göre eser de kesin buradadır. - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="A3BB099D4B0C93F71BC2C098E23BA48A", NativeString="It's gotta be here. It's gotta!! - Cerberus", LocalizedStrings=(("ar","يجب أن تكون هنا. مؤكد!! - سيربيروس"),("en","It's gotta be here. It's gotta!! - Cerberus"),("de","Es muss hier sein. Es muss!!! – Zerberus"),("es","Tiene que estar aquí. ¡Seguro! - Cerbero"),("es-419","Tiene que estar aquí. ¡Estoy seguro! - Cerbero"),("fr","Elle est là, je la sens !! - Cerbère"),("it","Dev'essere qui. Per forza! - Cerbero"),("ja","絶対ここにある。そのはずだ！！ - ケルベロス"),("ko","여기 있어야 돼. 있어야 된다고!! - 케르베로스"),("pl","To będzie tutaj! Na pewno! – Cerber"),("pt-BR","Tem que estar aqui, não é possível! — Cérbero"),("ru","«Он точно здесь!» — Цербер."),("tr","Burada olmalı. Burada! - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="A72257EF4F334840FEE193A4207174A2", NativeString="That sweet scent! I’d know it anywhere! - Cerberus", LocalizedStrings=(("ar","تلك الرائحة الجميلة! ألتقطها أينما ذهبت! - سيربيروس"),("en","That sweet scent! I’d know it anywhere! - Cerberus"),("de","Dieser wundervolle Geruch! Den erkenne ich sofort! – Zerberus"),("es","Ese olor tan maravilloso... ¡Lo reconocería en cualquier parte! - Cerbero"),("es-419","¡Qué delicioso aroma! ¡Es inconfundible! - Cerbero"),("fr","Cette délicieuse odeur ! Je la reconnaîtrais entre mille ! - Cerbère"),("it","Quell'odore delizioso! Lo riconoscerei ovunque! - Cerbero"),("ja","この甘いにおい！ 間違いないぞ！ - ケルベロス"),("ko","저 달콤한 향기! 어디서든 알아챌 수 있지! - 케르베로스"),("pl","Ten słodki zapach! Poznałbym go wszędzie! – Cerber"),("pt-BR","Eu reconheço esse cheiro doce em qualquer lugar! — Cérbero"),("ru","«Этот аромат! Его ни с чем не спутаешь!» — Цербер."),("tr","Bu güzel kokuyu her yerde tanırım! - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="55834E554A395D050220B8BDC0AC2E54", NativeString="Oops, wrong scent. Got it confused with my favorite chewing shoe. - Cerberus", LocalizedStrings=(("ar","عفوًا، رائحة خاطئة. لقد خلطت بينها وبين حذاء المضغ المفضل لدي. - سيربيروس"),("en","Oops, wrong scent. Got it confused with my favorite chewing shoe. - Cerberus"),("de","Ups, falscher Duft. Habe ihn mit meinem Lieblingskauschuh verwechselt. – Zerberus"),("es","Vaya, pues no era el olor que buscábamos... Me he confundido con el zapato que más me gusta morder. - Cerbero"),("es-419","Uy, confundí el olor con el del zapato que más me gusta morder... - Cerbero"),("fr","Je me suis trompé d'odeur. C'était juste la chaussure que j'adore mâchouiller. - Cerbère"),("it","Ops, odore sbagliato. L'ho confuso con la mia scarpa da masticare preferita. - Cerbero"),("ja","おっと、違うにおいだった。お気に入りの靴型の噛むおもちゃと間違えてたか。 - ケルベロス"),("ko","앗, 아니네. 내가 제일 좋아하는 씹기 전용 신발이랑 헷갈렸어. - 케르베로스"),("pl","Ups, pomyliło mi się z moim butem. – Cerber"),("pt-BR","Ops, confundi o cheiro com o de um sapato que adoro morder. — Cérbero"),("ru","«Ой, перепутал. Пахнет, как мой любимый ботинок!» — Цербер."),("tr","Ayy yanlış koku! En favori çiğneme ayakkabımla karıştırdım. - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="6DE6720F49A770E4976C3D9678978F9A", NativeString="Please leave it in my safe place for now. I’ll retrieve it when I'm off the clock. - Cerberus", LocalizedStrings=(("ar","حسنًا، أرجوك اتركها في مكاني الآمن مؤقتًا. سأستعيدها عندما يسمح لي الوقت. - سيربيروس"),("en","Please leave it in my safe place for now. I’ll retrieve it when I'm off the clock. - Cerberus"),("de","Bitte lasse es vorerst an einem sicheren Ort. Ich werde es abholen, sobald ich dazu komme. – Zerberus"),("es","Déjalo en mi lugar seguro por ahora. Lo recuperaré durante el descanso. - Cerbero"),("es-419","Déjalo en un lugar seguro por ahora. Lo recuperaré durante el descanso. - Cerbero"),("fr","Laissez-la dans ma cachette pour le moment. J'irai la chercher pendant ma pause. - Cerbère"),("it","Lascialo nel mio luogo sicuro per ora. Lo recupererò quando sarò fuori servizio. - Cerbero"),("ja","俺の安心できる場所に置いといてくれ。仕事が終わったら回収しに行くから。 - ケルベロス"),("ko","일단은 내 안전한 장소에 둬. 일이 끝나면 가지러 갈게. - 케르베로스"),("pl","Wiesz, lepiej zostaw go w moim schowku. Zabiorę go po pracy. – Cerber"),("pt-BR","Deixe no meu lugar seguro por enquanto. Quando eu estiver de folga, vou lá e pego. — Cérbero"),("ru","«Оставь-ка его в моём убежище. Я заберу его, когда освобожусь» — Цербер."),("tr","Lütfen şimdilik onu güvenli yerime bırak. Mesaim bitince ben gider getiririm. - Kerberos")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="BA46E443455966EDD10BB3832B4298B4", NativeString="GOOD DOG! Your secrets are safe with me. - Cerberus", LocalizedStrings=(("ar","متعاون مطيع! أسرارك آمنة معي. - سيربيروس"),("en","GOOD DOG! Your secrets are safe with me. - Cerberus"),("de","GUTER HUND! Deine Geheimnisse sind bei mir sicher. – Zerberus"),("es","¡Bien hecho! Tus secretos están a salvo conmigo. - Cerbero"),("es-419","¡Bien hecho! Tus secretos están a salvo conmigo. - Cerbero"),("fr","BON CHIEN ! Je ne révélerai vos secrets à personne. - Cerbère"),("it","BRAVO CAGNOLONE! I tuoi segreti sono al sicuro con me. - Cerbero"),("ja","いい子だ！ お前の企みは黙っといてやる。 - ケルベロス"),("ko","잘했어! 네 비밀은 지켜줄게. - 케르베로스"),("pl","DOBRY PIES! Twoje sekrety są ze mną bezpieczne. – Cerber"),("pt-BR","BOM CACHORRO! Pode deixar que não vou contar seus segredos. — Cérbero"),("ru","«Садись, пять! Так и быть, твои секреты никто не узнает» — Цербер."),("tr","Akıllı kuçu seni! Sırların benimle güvende.- Kerberos")))
