+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="FBB7937744B51093CC0377A5CE4B9792", NativeString="Tenacious hiker Silas is all about life on the trail! He knows everything about his favored vocation, from how to find a trail in an overgrown forest to how to make the perfect trail mix. (No peanuts, please!) If you're looking to wear in your hiking boots, Silas is your new best friend!", LocalizedStrings=(("it","Piero, il tenace escursionista, adora la vita da girovago! Il suo hobby non ha segreti per lui, da come trovare un sentiero nel mezzo di una foresta fittissima a come preparare gli spuntini perfetti per ogni escursione. (Le noccioline non rientrano in questa categoria!) Se fremi per indossare i tuoi scarponi nuovi, Piero è pronto a farti compagnia!")))
